import UserItem from "./UserItem";

function UserList(props) {
  if (props.users.length === 0) {
    return;
  }
  
  return (
    <ul className="user-list">
      {props.users.map((user) => (
        <UserItem
          username={user.username}
          age={user.age}
        />
      ))}
    </ul>
  );
}

export default UserList;
